import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper'
import '../App.css';

function ListItemLink(props) {
  return <ListItem button component = "a" {...props}/>;
}

export default function Scheduler(props) {

  const playlists = props.data.map((d) =>
    <ListItemLink key={d.uri} href={d.external_urls.spotify}>
        <ListItemText primary={d.name}>{d.name}</ListItemText>
      </ListItemLink>
    );

  return (
     <div className = "App" >
      <Card className="Card">
        <CardContent>
          <Typography gutterTop centered variant="h5" component="h1">
            Playlists
          </Typography>
        </CardContent>
        < CardContent >
        <Paper className="ScrollList">
          <List component="nav" aria-label="main">
              {playlists}
          </List>
          </Paper>
          </ CardContent>
      </Card>

    </div>
  );
}
